import React from "react";
import styled from "styled-components";

const Main = styled.div`
  background: green;
  width: 100%; 
  height: 70vh;
  display: flex;
  flex-direction: row;
`;

const Texts = styled.div`
  background: blue;
  width: 45%;
  height: 100%;
`;

const Graphics = styled.div`
  background: red;
  width: 55%;
  height: 100%;
`;

export default function index(props) {
  return (
      <Main>
        <Texts>
          {/* <Title></Title> */}
        </Texts>
        <Graphics></Graphics>
      </Main>
    );

}
